selector_to_html = {"a[href=\"guides/lbm_data.html#using-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.2. </span>Using Metadata<a class=\"headerlink\" href=\"#using-metadata\" title=\"Permalink to this heading\">#</a></h2><p>Each pipeline comes stocked with methods to retrieve imaging metadata.</p>", "a[href=\"#documentation-contents\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Documentation Contents<a class=\"headerlink\" href=\"#documentation-contents\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"guides/mbo_servers.html#filesystem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Filesystem<a class=\"headerlink\" href=\"#filesystem\" title=\"Permalink to this heading\">#</a></h2><p>!Note: Both workstation and compute file-systems are <em>NOT</em> backed up. Users should have a backup of all data on their own system.</p><p>The <code class=\"docutils literal notranslate\"><span class=\"pre\">D:</span></code> drive is <strong>read-only</strong> and contains</p>", "a[href=\"#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves raw tiffs with each z-depth and timepoint interleaved [zT]:</p>", "a[href=\"guides/mbo_servers.html#miniforge3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.1. </span>miniforge3<a class=\"headerlink\" href=\"#miniforge3\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has its own <code class=\"docutils literal notranslate\"><span class=\"pre\">Miniforge3</span></code> installation at <code class=\"docutils literal notranslate\"><span class=\"pre\">C:/Users/miniforge3</span></code>.</p><p>This is your environment to install and reinstall as you please. <em>DO NOT</em> install any software in the base environment as that will cause conflicts between all installed environments and require a reinstallation of miniforge3.</p>", "a[href=\"guides/mbo_servers.html#other-software\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.3. </span>Other Software<a class=\"headerlink\" href=\"#other-software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#miller-brain-observatory-compute-ecosystem\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Miller Brain Observatory: Compute Ecosystem<a class=\"headerlink\" href=\"#miller-brain-observatory-compute-ecosystem\" title=\"Permalink to this heading\">#</a></h1><p>A hub for tutorials, guides and resources for computational image processing.</p>", "a[href=\"guides/lbm_data.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h1><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#terms\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Terms<a class=\"headerlink\" href=\"#terms\" title=\"Permalink to this heading\">#</a></h2><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org/index.html\">ScanImage</a> acquisition software.</p>", "a[href=\"ref.html#ex-deinterleave\"]": "<figure class=\"align-default\" id=\"ex-deinterleave\">\n<img alt=\"ex_deinterleave\" src=\"_images/ex_deinterleave.svg\"/><figcaption>\n<p><span class=\"caption-text\">De-interleave Z-Planes</span><a class=\"headerlink\" href=\"#ex-deinterleave\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"guides/mbo_servers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Server Guide<a class=\"headerlink\" href=\"#server-guide\" title=\"Permalink to this heading\">#</a></h1><p>As a user of MBO servers you will be given a login and a password to on a Windows Server 2022 desktop to be used with windows remote desktop.\nThis login will give you access to all of the resources of that server, shared with a limited number of other users.</p>", "a[href=\"#blog-posts\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Blog Posts<a class=\"headerlink\" href=\"#blog-posts\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#pipelines\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pipelines<a class=\"headerlink\" href=\"#pipelines\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#external-resources\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">External Resources<a class=\"headerlink\" href=\"#external-resources\" title=\"Permalink to this heading\">#</a></h2><h3>Algorithms and pipelines<a class=\"headerlink\" href=\"#algorithms-and-pipelines\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"guides/mbo_servers.html#software\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h2><h3><span class=\"section-number\">2.2.1. </span>miniforge3<a class=\"headerlink\" href=\"#miniforge3\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has its own <code class=\"docutils literal notranslate\"><span class=\"pre\">Miniforge3</span></code> installation at <code class=\"docutils literal notranslate\"><span class=\"pre\">C:/Users/miniforge3</span></code>.</p><p>This is your environment to install and reinstall as you please. <em>DO NOT</em> install any software in the base environment as that will cause conflicts between all installed environments and require a reinstallation of miniforge3.</p>", "a[href=\"guides/mbo_servers.html#matlab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.2. </span>MATLAB<a class=\"headerlink\" href=\"#matlab\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has an installation of MATLAB.</p>", "a[href=\"guides/lbm_data.html#understanding-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Understanding Metadata<a class=\"headerlink\" href=\"#understanding-metadata\" title=\"Permalink to this heading\">#</a></h2><p id=\"scanimage-metadata\">ScanImage stores metadata about image size, frame rate, resolution, and regions of interest within the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file. Each pipeline handles this metadata for you, and provides an interface to use these values throughout the pipeline.</p><p>There is primary metadata, intended for use in a typical processing run. Many of these values are derived from less-pertinent (secondary) metadata.</p>", "a[href=\"#algorithms-and-pipelines\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Algorithms and pipelines<a class=\"headerlink\" href=\"#algorithms-and-pipelines\" title=\"Permalink to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
